// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.15;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "./Permissions.sol";

contract NFT is ERC721URIStorage, Permissions {
    uint public tokenCount;
    constructor() ERC721("Patent NFT", "PNFT"){}
    struct TokenInfo{
        uint tokenId;
        uint userId;
        address initialTokenOwner;
        address currentTokenOwner;
        string tokenURI;
    }

    mapping(uint => TokenInfo) public _tokenList;
    mapping(address => uint[]) public _ownedTokens;
    mapping(address => uint) public _ownedTokensCount;

    function mint(string memory _tokenURI, address _owner, uint _userId) external onlyAuthorisedPersonnel returns(uint) {
        tokenCount ++;
        _safeMint(_owner, tokenCount);
        _setTokenURI(tokenCount, _tokenURI);
        _tokenList[tokenCount] = TokenInfo(tokenCount, _userId, _owner, _owner, _tokenURI);
        _ownedTokensCount[_owner]++;
        _ownedTokens[_owner].push(tokenCount);

        return(tokenCount);
    }

    function transfer(address _to, uint _tokenId) external {
        safeTransferFrom(_tokenList[_tokenId].currentTokenOwner, _to, _tokenId);
        _tokenList[_tokenId].currentTokenOwner = _to;
    }

//Should be called by the token owner
    function giveApprovalToContract( uint _tokenId) external {
        approve(address(this), _tokenId);
        // approve(_authority, _tokenId);
    }

    function listTokens() public view returns (TokenInfo[] memory ){
        TokenInfo[] memory allTokens = new TokenInfo[](tokenCount);
        for(uint i=0; i<tokenCount; i++){
            allTokens[i] = _tokenList[i+1];
        }
        return allTokens;
    }

    function listTokensOf(address _address) public view returns(TokenInfo[] memory){
        uint ownedTokensCount = _ownedTokensCount[_address];
        uint[] memory ownedTokens = _ownedTokens[_address];
        TokenInfo[] memory ownTokens = new TokenInfo[](ownedTokensCount);
        for(uint i=0;i<ownedTokensCount;i++){
            ownTokens[i] = _tokenList[ownedTokens[i]];
        } 
        return ownTokens;
    }


}
